import React from 'react';

const ItemCard = ({ item }) => (
  <div className="item-card">
    <h3>오늘의 공구템 추천</h3>
    <img src={item.image} alt={item.name} />
    <p>{item.name}</p>
  </div>
);

export default ItemCard;
